Verenigde Staten / Duitsland
Komedie / Drama
97 minuten

geregisseerd door Michael Dowse
met Topher Grace, Anna Faris en Dan Fogler

Matt Franklin studeert af aan de universiteit zonder een idee te hebben wat hij nu verder met zijn leven moet gaan doen. Hij weet alleen dat hij tijdens een wild weekend op Labor Day zijn lievelingsmeisje wil versieren. Ondertussen worstelen hij, zijn tweelingzus en hun beste vriend met het volwassen worden.




